import React from 'react';
import { GeneratedImage } from '../types';

interface TreeGridProps {
  images: GeneratedImage[];
}

// Coordinate mapping for the 10-image tree (percentages relative to the template background)
const POSITIONS = [
  // Row 1 (1 image)
  { top: '12.8%', left: '41.3%', width: '17.2%', rotate: '-2deg' },
  // Row 2 (2 images)
  { top: '26.8%', left: '31.2%', width: '17.2%', rotate: '-3deg' },
  { top: '26.8%', left: '51.3%', width: '17.2%', rotate: '2deg' },
  // Row 3 (3 images)
  { top: '40.8%', left: '21.0%', width: '17.2%', rotate: '-2deg' },
  { top: '40.8%', left: '41.3%', width: '17.2%', rotate: '1deg' },
  { top: '40.8%', left: '61.6%', width: '17.2%', rotate: '-2deg' },
  // Row 4 (4 images)
  { top: '54.8%', left: '10.8%', width: '17.2%', rotate: '-3deg' },
  { top: '54.8%', left: '31.2%', width: '17.2%', rotate: '2deg' },
  { top: '54.8%', left: '51.4%', width: '17.2%', rotate: '-2deg' },
  { top: '54.8%', left: '71.8%', width: '17.2%', rotate: '3deg' },
];

// PASTE YOUR BASE64 IMAGE STRING HERE TO USE YOUR OWN TEMPLATE
const TEMPLATE_URL = "data:image/png;base64,";

// PASTE YOUR BASE64 OVERLAY IMAGE STRING HERE (Transparent PNG to sit on top)
const OVERLAY_URL = "data:image/png;base64,";

const TreeGrid: React.FC<TreeGridProps> = ({ images }) => {
  return (
    <div className="flex flex-col items-center w-full max-w-4xl mx-auto">
      <div 
        id="collage-capture-target" 
        className="relative w-full shadow-2xl overflow-hidden bg-white p-4 md:p-6 border-8 border-white"
        style={{ boxShadow: '0 25px 50px -12px rgba(0, 0, 0, 0.15)' }}
      >
        <div className="relative">
          {/* Background Template */}
          <img 
            src={TEMPLATE_URL || "https://placehold.co/1080x1350/e0f2fe/0369a1?text=Paste+Template+In+Code"} 
            alt="Christmas Tree Template" 
            className="w-full h-auto block"
            crossOrigin="anonymous" 
            referrerPolicy="no-referrer" 
            onError={(e) => {
              console.error("Template failed to load:", e);
              const target = e.target as HTMLImageElement;
              if (!target.src.includes('placehold.co')) {
                 target.src = "https://placehold.co/1080x1350/e0f2fe/0369a1?text=Template+Load+Error";
              }
            }}
          />
          
          {/* Overlaid Generated Images */}
          {POSITIONS.map((pos, index) => {
            const img = images[index];
            const imageUrl = img ? img.url : null;

            if (!imageUrl) return null;

            return (
              <div
                key={img?.id || index}
                className="absolute overflow-hidden bg-sky-50"
                style={{
                  top: pos.top,
                  left: pos.left,
                  width: pos.width,
                  aspectRatio: '1/1',
                  transform: `rotate(${pos.rotate})`,
                }}
              >
                <img 
                  src={imageUrl} 
                  alt={`Portrait ${index + 1}`}
                  className="w-full h-full object-cover"
                />
              </div>
            );
          })}

          {/* Foreground Overlay - Sits on top of generated images */}
          {/* Paste your transparent PNG code in the OVERLAY_URL constant above */}
          <img 
             src={OVERLAY_URL || "https://placehold.co/1080x1350/png?text=Paste+Overlay+In+Code"} 
             alt="Foreground Overlay"
             className="absolute inset-0 w-full h-full object-cover pointer-events-none z-20"
             crossOrigin="anonymous"
             onError={(e) => {
                const target = e.target as HTMLImageElement;
                if (!OVERLAY_URL) {
                    // If no user overlay is provided, we might hide the placeholder to not block view
                    // or keep it if in dev mode. Hiding it here for cleaner UX if empty.
                    // target.style.display = 'none'; 
                }
             }}
          />
        </div>
      </div>
      
      <div className="mt-8 text-center text-sky-400/60 text-sm font-elegant animate-pulse">
        <p> Ready to share with family and friends! </p>
      </div>
    </div>
  );
};

export default TreeGrid;